    <br>
    <button onclick="$('input').click()" id="fakebutton">Upload Pack</button><br><br>
    <div id="packtype">

            <option value="Auto" id="autopick">Pack Type: Auto</option>

    <button type="button" class="collapsible" style="color:#e04c4c;">Non-Vanilla Textures <img title="Download List" src="ui_icons/download.png" class="funcimg" onclick="download('nonvanillatextures',cleanhtml($('red').innerHTML))"> <img title="Copy List" src="ui_icons/copy.png" class="funcimg" onclick='navigator.clipboard.writeText(cleanhtml($("red").innerHTML));'></button>
    <div class="content" id="red">
        <p class="green">Nothing Found! :D</p>
    </div><br><br>
    <button type="button" class="collapsible" style="color:#e08a2d;">Unchanged Textures <img title="Download List" src="ui_icons/download.png" class="funcimg" onclick="download('unchangedtextures',cleanhtml($('orange').innerHTML))"> <img title="Copy List" src="ui_icons/copy.png" class="funcimg" onclick='navigator.clipboard.writeText(cleanhtml($("orange").innerHTML));'></button>

    </div>

        <p id="percenttext">0% Textures Changed</p>
    </div>
    <input type="file" id="input">
    
    <script src="https://cdn.rawgit.com/Stuk/jszip/v3.0.0/dist/jszip.min.js"></script>
    <script>
    var ctprefix;
    var unchanged;
    var nonvanilla;
    var ver;
    var zip = new JSZip();
    $('input').onchange = dozip;
    $('typepick').onchange = dozip;
    
    function dozip() {
        if ($("input").files.length>0) {
            var f = $("input").files[0];
            $('fakebutton').innerHTML = "Upload Pack: "+f.name;
            $('red').innerHTML = "";
            $('orange').innerHTML = "";
            // filter through files and hold them
            JSZip.loadAsync(f).then(async function(zip) { // load zip
                if (zip.file(/pack.mcmeta/).length==0) { // check if pack.mcmeta exists
                    return(["No mcmeta",zip]);
                } else {
                    let ret = await zip.file(/pack.mcmeta/)[0].async('text'); // load pack.mcmeta data
                    return([ret,zip]);
                }
            },function(e){alert(e);}).then(function(returned){
                // determine which game version
                let zip = returned[1];
                nonvanilla = [];
                try {
                    if (returned[0]=="No mcmeta" || f.name.split(".").pop()=="mcpack" || zip.folder(/assets\/minecraft\//).length==0) { // beckrock because mcpack or no /assets/minecraft/ folder
                        ver = "Bedrock";
                    } else if (JSON.parse(returned[0])["pack"]["pack_format"]==1){ // if 
                        ver = "1.8.9";
                    } else {
                        ver = "Java";
                    }
                } catch(e){ver = "Java"}
                $('autopick').innerHTML = "Pack Type: Auto ("+ver+")";
                if ($('typepick').value!="Auto") { // manual override pack type
                    ver = $('typepick').value;
                }
                unchanged = [...idxs[ver]];
                if (ver=="Bedrock") {
                    ctprefix = "textures/";
                } else {
                    ctprefix = "assets/minecraft/textures/";
                }
                for (zipEntry of Object.keys(zip.files)) { // loop through uploaded files
                    if (zipEntry.includes(ctprefix) && ["png","tga","jpg","jpeg"].includes(zipEntry.split(".").pop()) && !zipEntry.includes("MACOSX")) { // filter checkable textures
                        zipEntry = ("f"+zipEntry).split(ctprefix)[1]; // remove useless prefix
                        if (idxs[ver].includes(zipEntry)) {
                            unchanged.splice(unchanged.indexOf(zipEntry), 1); // remove from unchanged list
                        } else {
                            nonvanilla.push(zipEntry);
                        }
                    }
                }
                $('red').innerHTML='<p>'+nonvanilla.join('</p><p>')+'</p>'; // add to nonvanilla list
                $('orange').innerHTML='<p>'+unchanged.join('</p><p>')+'</p>'; // add to unchanged list
                pct = Math.floor((1-(unchanged.length/idxs[ver].length))*100);
                $('percenttext').innerHTML = pct + "% Textures Changed";
                $('barholder').style.background =  "linear-gradient(90deg, #38c736 0% "+pct+"%, black "+pct+"% "+(100-pct)+"%)";
                
                // add nice no error messages
                if (cleanhtml($('red').innerHTML).split("\n").join("")=="") {
                    $('red').innerHTML='<p class="green">Nothing Found! :D</p>'
                }
                if (cleanhtml($('orange').innerHTML).split("\n").join("")=="") {
                    $('orange').innerHTML='<p class="green">Nothing Found! :D</p>';
                }
            },function(e){alert(e);});
        }
    }
    
    //collapsables
    var coll = document.getElementsByClassName("collapsible");
    var i;
    for (i = 0; i < coll.length; i++) {
        coll[i].addEventListener("click", function() {
            this.classList.toggle("active");
            var content = this.nextElementSibling;
            if (content.style.display === "block") {
                content.style.display = "none";
            } else {
                content.style.display = "block";
            }
        });
    }
    //download text
    function download(filename, text) {
        var element = document.createElement('a');
        element.setAttribute('href', 'data:text/plain;charset=utf-8,' + encodeURIComponent(text));
        element.setAttribute('download', filename);
        element.click();
    }
    function cleanhtml(t) {
        return(t.replace("<p class=\"green\">","").split("<p>").join("").split("</p>").join("\n"));
    }
    
    function $(id) {
        return(document.getElementById(id));
    }
